document.getElementById("cerrarSesion").addEventListener("click",function(e){e.preventDefault(),Swal.fire({title:"¿Estás seguro de que deseas cerrar sesión?",showCancelButton:!0,confirmButtonText:"Sí",cancelButtonText:"No"}).then(e=>{e.isConfirmed?Swal.fire("Has cerrado sesión","","success").then(()=>{window.location.href="../../controller/AutenticacionController/logout.php"}):Swal.fire("Cancelado","","info")})});